import React, { Component } from 'react';
import { Container, Image, Col, Row, InputGroup, FormControl } from 'react-bootstrap';
import '../styles/UserProfile.css'

class UserProfile extends Component {

	render() {
		return (
			<Container>
				<Row md={4}>
					<Col className="col_user_profile_left" xs={3} md={3} lg={3} style={{ padding: '1%'}}>

						<Image className="profile_image" src="/Images/users/1.jpg" rounded />
						<hr className="through_image_line" />
					</Col>

					<Col className="col_user_profile_middle" xs={9} md={9} lg={9}>

						<Container >
							<InputGroup className="mb-3">
								<InputGroup.Prepend>
									<InputGroup.Text id="basic-addon1">@</InputGroup.Text>
								</InputGroup.Prepend>
								<FormControl
									placeholder="Username"
									aria-label="Username"
									aria-describedby="basic-addon1"
								/>
							</InputGroup>
						</Container>
					</Col>
				</Row>
			</Container>
		);
	}
}

export default UserProfile;
